import React from 'react';

import {Simpson} from "./Simpson";

const Simpsons = () => {

    const simpsons = [
        {id:1, name: 'Bart', age: 12, image:'data:image/png;base64,' },
        {id:2, name: 'Gomer', age: 10, image:'data:image/png;base64,' },
        {id:3, name: 'Margo', age: 3, image:'data:image/jpeg;base64,' }

    ]

    return (
        <div>
            {simpsons.map(simpson=><Simpson key={simpson.id} simpson={simpson}/>)}
        </div>
    );
};

export {Simpsons};